You talk about the crazy animals Darius sees! When I learnt to fly at Titusville, I'm from the UK BTW, one of the lessons over the Everglades, the instructor said to me always be aware of a safe place to land in the woods.
 Woods? Frigging woods? I said. You've got alligators, snakes, bears, poisonous spiders, panthers and fire ants down there, That's a frigging jungle;
 squirrels live in woods, deer live in woods  mice live in woods where  i live.

